import React from "react";
import Wallpaper from "../commonwallpaper/Wallpaper";
import Footer from "../sign-In/Footer";
import netflixlogo from "../../assets/netflix-logos-idcIWizlPG.png";
import Dropdown from "../commonwallpaper/Dropdown";
import "./SignUp.scss"

function SignUp() {
  return (
    <div
      className="bg-black bg-opacity-100 overflow-hidden"
      style={{ backgroundColor: "#000" }}

    > 
    <div class="flex">

    <div class="flex items-center flex-shrink-0 text-white mr-6">
    <svg class="fill-current h-8 w-8 mr-2" width="54" height="54" viewBox="0 0 54 54" xmlns="http://www.w3.org/2000/svg"><path d="M13.5 22.1c1.8-7.2 6.3-10.8 13.5-10.8 10.8 0 12.15 8.1 17.55 9.45 3.6.9 6.75-.45 9.45-4.05-1.8 7.2-6.3 10.8-13.5 10.8-10.8 0-12.15-8.1-17.55-9.45-3.6-.9-6.75.45-9.45 4.05zM0 38.3c1.8-7.2 6.3-10.8 13.5-10.8 10.8 0 12.15 8.1 17.55 9.45 3.6.9 6.75-.45 9.45-4.05-1.8 7.2-6.3 10.8-13.5 10.8-10.8 0-12.15-8.1-17.55-9.45-3.6-.9-6.75.45-9.45 4.05z"/></svg>
    <span class="font-semibold text-xl tracking-tight"><img
          class="h-auto"
          className="img-logo1"
          src={netflixlogo}
          alt="netflix-logo"
          style={{ color: "red" }}
        /></span>
  </div>

    {/* <div className="logo-container1">
        <img
          class="h-auto"
          className="img-logo1"
          src={netflixlogo}
          alt="netflix-logo"
          style={{ color: "red" }}
        />
          </div>
         */}

         <div
       class="inline-block text-sm px-4 py-2 leading-none border rounded text-white border-white hover:border-transparent hover:text-teal-500 hover:bg-white mt-4 lg:mt-0"

        style={{backgroundColor:"white"}}
      >
        <Dropdown />
      </div>

       </div>




      <div>
        <Wallpaper />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default SignUp;
